// SPDX-License-Identifier: GPL-3.0
pragma solidity >= 0.7.0 < 0.9.0;

// data type
contract lec2{
    //data type
        //boolean, bytes, address, uint
    
    //reference type
        //string, arrays, struct
    
    //mapping type

    //이번 강의는 data type에 대해 공부

    //boolean : true / false
    bool public b = false;

    // ! || == &&
    bool public b1 = !false; //true
    bool public b2 = false || true; //true
    bool public b3 = false == true; //false
    bool public b4 = false && true; //false

    // bytes 1 ~ 32, 256bit까지 표현 가능
    bytes4 public bt = 0x12345678;
    bytes public bt2 = "STRING";

    // address 
    address public addr = 0xd8b934580fcE35a11B58C6D73aDeE468a2833fa8; //40글자 -> 20byte

    // int vs uint
    
    // int8 (-2^7 ~ 2^7 -1)
    int8 public it = 4;
    // uint8 (0 ~ 2^8 -1)
    uint256 public uit = 132213;
    // + - * /

    // uint8 public uit2 = 257; ==> error
}

